(99, 363, 'Tout sue la CRYPTO ECOLO sur MOBILE', ' la Cryptomonnaie MTcore 100 % ECOLO sur SMARTPHONE / PC et Tablette.  TOUT LE MONDE aura la chance de gagner de l’argent même ceux qui ne développent pas.  https://lcrypto-ecolo.blogspot.com\r\n', 5, 'journalperso', 1),
(100, 363, 'CREER votre BUREAU VIRTUEL Gratuit', 'Avec votre BUREAU VIRTUEL vous créez votre communauté et on vous rémunère pour ça. ARCHIVEZ, PARTAGEZ VOTRE WEB Plus besoin de prendre des notes, créer des favoris, faire des copier / coller. Archivez vos sites préférés dans votre compte Ajoox\r\nhttps://agir-aujourdhui.blogspot.com', 25, 'journalperso', 1),
(101, 363, 'La Crypto-Economie pour les AUDACIEUX', 'TOUT LE MONDE aura la chance de gagner de l’argent, même ceux qui ne recommande pas\r\nVos actions d&#39;aujourd&#39;hui changerons votre quotidien de demain.... Si tu ne fais aucune action aujourd&#39;hui, comment veux-tu changer ton quotidien demain ?\r\n\r\nUne Crypto avec forte valorisation réel sans risque de volatilité des cryptos actuelles.\r\n \r\nhttps://audacieux-cryptoeconomie.blogspot.com', 5, 'journalperso', 1),
(102, 363, 'Pouvoir travailler avec son smartphone et  tablette', 'Possibilité de faire partie du monde numérique car le mobile tire la croissance car il est devenu le premier écran de connexion.\r\nAvez-vous déjà songé à travailler depuis votre smartphone, tablette et pc\r\n Innovation technologique du minage de la cryptomonnaie 100 % ECOLO avec le SMARTPHONE....\r\nhttps://crypto-mobile-only.blogspot.com', 6, 'journalperso', 1),
(103, 363, 'MTcore nouvelle crypto ecolo', '\r\nUne nouvelle opportunité dans la cryptoéconomie solide avec un potentiel énorme et surtout un travail hyper carré en amont pour garantir la pérrénité de la société sur du très long terme. Super concept très innovant avec un très grand avenir. Terminé la pollution et la consommation d&#39;énergie à outrance pour les crypto monnaies.\r\nhttps://cryptoeconomie.blogspot.com', 2, 'journalperso', 1),
(104, 363, 'ETRE un EXPERT Apprendre à faire de la publicité', '   Être un expert dés maintenant et gratuitement.\r\nAccédez à notre centre d’apprentissage «apprendre à faire de la publicité» tout à fait gratuitement avec tout achat de publicité. Même les débutants complets sur Internet peuvent commencer des campagnes publicitaire\r\nhttps://www.hashingadspace.com/register.php?ref=affichage25', 4, 'journalperso', 1),
(105, 363, 'Un BUREAU VIRTUEL pour tout le monde', 'BUREAU VIRTUEL pour tout le monde un service en ligne, accessible n&#39;importe où sur PC,Tablette et Mobile\r\nNouveau service web innovant et nous sommes parmi les premiers PIONNIERS !\r\nhttps://bureau-virtuel-pour-tout-public.blogspot.com', 6, 'journalperso', 1),
(106, 363, 'Nouveau réseau social gratuit', 'Xenzuu est la plate-forme de médias sociaux\r\nXenzuu, votre réseau social, qui paie les membres actifs pour  utilisation ceci à l&#39;échelle mondiale et surtout Gratuit\r\nGAGNER DE L&#39;ARGENT SUR INTERNET\r\nGratuitement, facilement et rapidement ! Un site qui paye!\r\nhttps://xenzuu-reseau-social.blogspot.com', 3, 'journalperso', 1),
(107, 363, 'FAIRE QUELQUE CHOSE POUR LA TERRE', ' C&#39;est tout gratuit, sans souci, et pour une noble cause donc dés maintenant venez voir comment ça marche et combien ça rapporte et pour cela voyez combien vous pouvez gagner avec notre calculette\r\nInvitez plus de personnes, Oui, la même façon que gagner plus d’argent\r\nhttps://bUnited.com/inviter/BDYZ-8273/05/', 3, 'journalperso', 1),
(108, 363, 'Créer un monde sûr, durable et équitable', 'Tous ensemble pour réussir, nous devons nous unir, c’est tout.\r\nE MOMENT EST VENU D’AIDER LA TERRE ET D&#39;ÊTRE PAYÉ POUR S’UNIR\r\nCRÉER UN MONDE MEILLEUR \r\nhttps://inviteztouslesgensquevousconnaissez.blogspot.com', 2, 'journalperso', 1),
(109, 363, 'Connectez entre vous tous', 'OPPORTUNITE MONDIALE, POSSIBILITÉ DE FAIRE PARTIE DU MONDE NUMÉRIQUE, EN PARTICIPANT À UN CHANGEMENT DE MENTALITÉ TECHNOLOGIQUE.\r\n\r\nhttps://connectez-entre-vous-tous.blogspot.com', 2, 'journalperso', 1),
(110, 363, 'La Bourse en ligne', 'Online-stock-exchange est une plateforme récente d&#39;aide à la réalisation de projets en tous genres\r\nLa bourse en ligne sont un moyen idéal pour plonger votre pied dans le marché boursier \r\nhttps://laboursenligne.blogspot.com', 3, 'journalperso', 1),
(111, 363, 'A partir de quand est-on riche', 'Pour sérier cette question, il faut avoir une double approche : en termes de flux c’est-à-dire de revenus, et en termes de stocks c’est à dire de patrimoine (immob, financier ou professionnel, nouvelle monnaie numérique, etc..). ONLINE-STOCK-EXCHANGE la Bourse En Ligne\r\nhttps://richetvous.blogspot.com', 3, 'journalperso', 1),
(112, 363, 'Véhicules tout-électriques et vous', 'Demain la voiture électrique et votre participation au projet à la mobilité et aussi à l&#39;environnement écologique. Le bilan environnemental semble donc être très favorable à la voiture électrique.\r\n\r\nhttps://vehicules-tout-electriques.blogspot.com', 5, 'journalperso', 1),
(113, 363, 'Faire partie du monde numérique,', 'Aujourd&#39;hui je fais parti d&#39;une société proposant quelque chose d&#39;innovant, à un point inimaginable. \r\nCe n&#39;est pas un rêve, prenez part à cette opportunité. Comment changer de vie ici et MAINTENANT : Définissez des objectifs, ne les perdez pas de vue et ne ménagez pas vos efforts. https://royalties-online.blogspot.com', 3, 'journalperso', 1),
