(27, 72, 'texte', '<div>Bonjour, nous sommes le 29 Avril 2019; Il est 16 h 19</div><div><br></div><div>Je crée ce Journal pour les personnes qui ont dans leur famille; leurs proches une personne ayant la maladie d\'Alzimer car à ce jour on ne connait très peu cette maladie.</div>', '', '2019-04-29 16:26:49', ''),
(28, 72, 'texte', '<div>Si vous avez des astuces pour aider les aidants donnez les car ce n:est pas évidant quant on ne connait pas trop la maladie d\'Alzimer.</div><div>Photographiez les bons moments que vous passer avec la personne et oublier les mauvais moments.</div><div>.</div>', '', '2019-04-30 21:29:05', ''),
(29, 73, 'image', '', 'publications/images/012(3).JPG', '2019-05-03 11:12:58', 'notre chatte gazelle entrain de manger '),
(30, 73, 'texte', 'Pour continuer je voudrais vous dire que je suis un alsacien d\'origine et que je suis fier d\'être rester un alsacien de coeur, .Cela fait assez longtemps que je ne suis plus aller voir ma famille dans ma région d\'origine mais nous allons y retourner pour un week end au mois de Juillet . Un week end ca fait pas long je sais mais on a pas trops le choix car ma femme es entrain de faire une formation de Facilitateur Numérique a l\'AFPA et elle ne veut pas louper trops de jours .', '', '2019-05-03 11:15:39', ''),
(31, 73, 'image', '', 'publications/images/generationRacing.jpg', '2019-05-03 11:17:18', 'mon club de coeur '),
(33, 76, 'texte', 'Bonjour, je m&#39;appelle y****** j&#39;ai 18 ans dans 3 mois. Je suis ici pour partager avec vous,une vie quelques peu difficile.. Surtout sur le plan émotionnel c&#39;est ça que je veux partager.. J&#39;aimerai qu&#39;on me comprenne qu&#39;on partage mes opinions mes idées. Qu&#39;on sache qui je suis tout simplement,que s&#39;il m&#39;arrive malheur,que je ne parte pas incomprise et oubliée.. Merci à vous qui allez me rejoindre sur ce journal.\r\n#Y', '', '2019-05-09 12:19:09', ''),
(35, 72, 'texte', '<div>Bonjour,</div><div><br></div><div>Si la personne atteinte de la maladie d\'Alzimer est énervé vous pouvez la calmer avec une feuille papier à colorier, où une feuille blanche avec des crayons de couleurs, où écouter de la musique douce, regarder un livre avec images, un documentaire sur les animaux et des jolis paysaages.</div>', '', '2019-05-09 13:37:43', ''),
(36, 73, 'texte', 'A quelque jours des élections Européennes je voudrais vous dire mon opinion sur ce sujet . L’Europe es entrain de s\'autodétruire a petit feu, parce que chaque état de l\'union veut obtenir ce qu\'il veut et PERSONNE ne fait rien pour que tout le monde avance sur le même chemin . Pour moi le mieux serait de refaire les statuts de l\'Union européenne et de changer la donne . Faire un peu comme en Amérique ou ils ont réussi a scinder le continent en plusieurs partie ... Le Nord, le sud et le Centre . Pourquoi pas faire pareil en Europe . Faire une Europe du Sud (Espagne, Portugal, France, Italie, Grèce), une Europe Centrale (Allemagne, Benelux, Russie, Autriche...)et une Europe du Nord (Suède, Finlande,Danemark...). Je pense franchement que ce serait plus judicieux et en même temps on rebattrait les cartes . Notre Vieille Dame l\'Europe commence sérieusement a essouffler. Concernant ensuite le nombre de Liste qui se présente en France, je trouve ca un peu débile d\'avoir autant de Liste, ca va encore donner un sérieux avantage a celui qui es entrain de détruire notre beau pays a petit feu . Mais bon, c\'est des paroles qui resteront des paroles, car personne n\'a vraiment envie de faire partir cette escroc de notre pays . Personne n\'à le courage de dire Haut et Fort ce qu\'il pense tout bas . Voila mon opinion et j\'espère que cela va pas créer un autre climat de tension .&nbsp;', '', '2019-05-14 09:03:41', ''),
(37, 77, 'texte', '<span style=\"color: rgb(25, 30, 35); font-family: &quot;Noto Serif&quot;; font-size: 16px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">Suspendu trois matches ferme par la Fédération française de football, suite à une altercation avec un spectateur du Stade de France, Neymar a eu une mauvaise nouvelle ce mercredi. </span><span style=\"color: rgb(25, 30, 35); font-family: &quot;Noto Serif&quot;; font-size: 16px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">Malheureusement, le dossier ne sera pas étudié ce jeudi en raison d\'un calendrier trop surchargé de la Commission de discipline. Résultat des courses, l\'attaquant du Paris Saint-Germain ne pourra pas rejouer avec son club avant la saison prochaine. </span>', '', '2019-05-15 16:54:26', ''),
(38, 79, 'texte', 'LE VRAIS AMOUR\r\nLe vrais amour est un amour qui a une base spirituelle qui peut être un  stimulant pour les études et un appui moral.\r\nLe vrais amour purifie les cours des amoureux leurs pensées et leurs actions .\r\nIl les incite tous à la fidélité sentiment solidarité et  s&#39;entraide mutuellement à l&#39;endurance au travail et ils partagent ou affrontent aux difficultés aux  barrages aux virus de la vie.\r\nLe slogan du vrais amour est la fidélité le sentiment le respect et la paix.\r\nL&#39;arme des amoureux est toujours braqué pour éliminer ou tuer la faiblesse l&#39;infidélité la trahison  le déshonneur  le chagrin la tristesse.\r\nLe mot clef pour elimer tout virus qui attaque leur amour est (( le pardon)) qui est voué l&#39;un pour l&#39;autre avec respect sentiment et douceur.\r\nToujours pour renouveler leur amour ils se souvient toujours la belle phrases qui les à uni  et ils l&#39;emploi avec tendresse amour et sentiment en disant ((je t&#39;aime de tout mon coeur))\r\nVoilà le secret des vrais amoureux qui ne se sont pas aimé pour la cause d&#39;argent, la beauté du sexe ou quoi que se soit cet amour est purement physique qui a bon bon début et une mauvaise fin.\r\nEt voilà le signé de la destruction de l&#39;amour physique.\r\n1) la diminution du temps de l&#39;un pour l&#39;autre\r\n2) la manque de satisfaction du rapport sexuelle.\r\n3) la diminution du respect et sentiment.\r\n4) La perte de confiance et la suppression de la jalousie.\r\n5) le non respect du programme conclu.\r\n6) le non résistance contre le colère et changement de douceur à l&#39;attaque.\r\n7) la provocation sans cause.\r\nVoilà les sept points qui marque le début de la destruction de l&#39;amour physique tandis-que chez l&#39;amour véritable sont le contraire des sept points.\r\nToujours pour vous quitter je vais bientôt lancer un enseignement sur la vie. Merci\r\n\r\n', '', '2019-05-25 12:44:29', ''),
(39, 78, 'texte', '\r\n\r\n<p style=\"margin: 0px;\"><b><span style=\'margin: 0px; color: rgb(255, 120, 0); font-family: \"Verdana\",\"sans-serif\"; font-size: 10.5pt;\'>Conte de soeur Jeanne</span></b></p>\r\n\r\n<p align=\"left\" style=\"margin: 0px; text-align: left;\"><span style=\'margin: 0px; color: rgb(85, 96, 116); font-family: \"Verdana\",\"sans-serif\"; font-size: 8.5pt;\'>Soeur Jeanne ayant fait\r\nun poupon, <br>\r\nJeûnait, vivait en sainte fille.<br>\r\nToujours était en oraison.<br>\r\nEt toujours ses soeurs à la grille.<br>\r\nUn jour donc l\'abbesse leur dit;<br>\r\nVivez comme soeur Jeanne vit;<br>\r\nFuyez le monde et sa séquelle<br>\r\nToutes reprirent à l\'instant:<br>\r\nNous serons aussi sages qu\'elle<br>\r\nQuand nous en aurons fait autant.</span></p>\r\n\r\n<font size=\"3\"></font><font face=\"Times New Roman\"></font>\r\n\r\n<p style=\"margin: 0px;\"><b><i><span style=\'margin: 0px; color: rgb(51, 51, 51); font-family: \"Arial\",\"sans-serif\"; font-size: 13.5pt;\'>Jean de la Fontaine</span></i></b><b><span style=\'margin: 0px; color: rgb(255, 120, 0); font-family: \"Verdana\",\"sans-serif\"; font-size: 10.5pt;\'>&nbsp;</span></b><br></p>', '', '2019-06-10 09:49:11', ''),
