(50, 83, 'texte', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:16.0pt;line-height:107%\">Biographie Ange-José Michelin<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">Bonjour, je m’appelle Ange-José\r\nMichelin je suis né le 01/01/1993 à Paris, 14eme arrondissement en France. Je\r\nsuis d’origine Française et Italienne, je porte de nom de famille de mon père.\r\nJe parle couramment le français car c’est ma langue maternelle mais je suis\r\nassez à l’aise en anglais grâce aux cours d’anglais des écoles que j’ai faites\r\net grâce aux voyages que j’ai fait en Amérique et au Canada…<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">Au moment où j’écris cela je\r\nréside chez ma mère (Rosanna Falessi) et je ne suis pas forcement au top de ma\r\nforme… J’ai une copine à ce jour qui s’appelle Dalila et je pense que c’est la\r\nbonne fille pour moi nous voulons passer notre vie entière ensemble nous nous\r\naimons énormément. J’ai beaucoup confiance en elle et j’espère qu’elle lira\r\nceci un jour.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">J’ai fait des études jusqu’à mes\r\n24ans et ensuite j’ai ressenti une énorme fatigue mentale et ai dû être interné\r\net aller à l’hôpital. J’ai fait un parcours banal, études jusqu’au Bac\r\nscientifique option Physique-Chimie au lycée Buffon, Paris (le plus grand et le\r\nmeilleur lycée de Paris et peut être de France), je suis donc Physicien\r\nChimiste et je fais aussi des mathématiques. Ensuite après le Bac j’ai fait 6\r\nans d’études supérieures dans l’informatique dans 4 écoles différentes mais je\r\nn’ai validé qu’un BTS SIO option SLAM. Pendant mes études supérieures je suis\r\ntomber plusieurs fois malade mentalement mais j’ai quand même réussi.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">J’ai rencontré énormément de\r\npersonnes pendant toute ses années et ai trouver ma vie plutôt agréable et\r\npassionnante.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">Mon but au moment ou je vous\r\nparle est de trouver un travail dans l’informatique mais c’est très dur à\r\ntrouver et je n’ai pas de logement pour l’instant. J’ai créer un site internet\r\n(<a href=\"http://www.journalperso.fr/\">www.journalperso.fr</a>) pour m’occuper\r\nun peu l’esprit et pour essayer de gagner de l’argent mais pour l’instant c’est\r\ndifficile mais peut-être que dans le future cela sera différent.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">Sinon en ce moment enfaite je\r\nsuis plutôt en forme mais je suis accro à la cocaïne et cela me pourris la vie,\r\nj’adore cette drogue qui me stimule mais elle me pousse vraiment vers le bas.\r\nJ’en prend pour être plus efficace au travail je peux passer des nuits sans\r\ndormir sur les écrans et cela rend la cohabitation avec ma mère très difficile.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">J’ai souvent été accro aux drogue\r\ndans ma vie au lycée je fumais du shit tout le temps et étais très un élève\r\nperturbateur hélas… Je me suis assagi car j’avais énormément de colère en moi..<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">Je m’en suis sorti plutôt bien au\r\nfinal.<o:p></o:p></p>', '', '2019-06-21 04:21:03', ''),
