(54, 86, 'texte', '<div class=\"wpb_text_column \" style=\"box-sizing: border-box; text-align: justify; background-color: rgb(255, 255, 255);\"><div class=\"wpb_wrapper\" style=\"box-sizing: border-box;\"><h2 style=\"color: rgb(38, 219, 38); font-family: inherit; font-size: 38px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; box-sizing: border-box; line-height: 1.4; margin: 0px 0px 1.5rem; padding-top: 0px; letter-spacing: -1px; text-align: center;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Et si vous deveniez naturopathe pour ?</span></span></h2><div style=\"\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box;\"><div style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Comme nous, vous avez sans doute constaté que nos sociétés de consommation sont empreintes d’incitation à acheter des produits remplis de composants néfastes pour notre santé et notre bien-être.</div><div style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></div><div style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Comme nous, vous avez probablement observé que nous allons bien trop facilement à des solutions de facilité pour apaiser rapidement les maux que notre corps exprime. Par exemple lorsque vous avez une migraine, votre premier réflexe est de prendre un cachet, si vous avez de la fièvre, vous ne lui laissez pas le temps de remplir son rôle, lorsque vous avez une infection, vous prenez des antibiotiques, etc.</div><div style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></div><div style=\"\"><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Le constat est simple : notre corps s’est « encrassé » et s’est affaibli en raison de nos modes de vie et de nos habitudes alimentaires. Sédentarité, pollution urbaine, produits chimiques présents dans la majorité des produits de consommation, même d’hygiène… Autant de facteurs qui ont contribué au développement de nouvelles affections, comme les allergies, les intolérances, les difficultés respiratoires, les troubles gastro-intestinaux et bien d’autres. La liste est longue en vérité.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Vous vous dites sans doute que c’est inéluctable, que c’est l’évolution logique des sociétés et, quelque part, le prix à payer pour notre niveau de vie. Dans un sens, vous avez raison si l’on considère que l’accès aux soins, aux traitements chimiques est facile, et qu’au bout du compte les avancées de la médecine dans de nombreux domaines permettent d’être soigné, de guérir même d’affections dont pouvaient mourir nos grands-parents ou nos parents.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">C’est vrai. Mais d’une certaine façon seulement.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Car hormis certaines pathologies particulièrement graves qui nécessitent un accompagnement médical précis, nombreuses sont les affections qui peuvent être évitées par un changement d’hygiène de vie ou traitées par des moyens simples.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Car notre corps est une véritable machine de guerre, n’en doutez pas une seconde. Si vous le désarmez, comment voulez-vous qu’il puisse se défendre correctement ? C’est en cela que la Naturopathie est une véritable ressource qui nous permet de reprendre la main sur notre vie, notre santé, notre hygiène alimentaire. Considérée comme une médecine traditionnelle, c’est tout simplement l’art de la santé au naturel.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">La naturopathie n’est pas une discipline nouvelle, c’est ainsi que nos anciens (finalement pas très éloignés de nous) se soignaient. C’est l’adoption de nouveaux comportements alimentaires, comme la compréhension de l’utilité des différents jeûnes par exemple, et c’est surtout la connaissance de soi, du corps, de son fonctionnement, de ses dynamiques.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Quelque part, nous faisons tous un peu de naturopathie au quotidien : lorsque vous prenez une tisane pour vous détendre ou pour éliminer par exemple, vous allez faire confiance à la plante choisie pour obtenir un effet précis. Mais il reste que nous traitons les affections plutôt que de les prévenir.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">C’est en cela que l’apprentissage de la naturopathie est différent : elle s’occupe de la santé, de la maintenir, de la protéger, pour éviter l’apparition de troubles. Elle permet d’appréhender notre environnement sous un autre jour et d’apprendre comment interagir avec, pour tout simplement se sentir bien, prendre du plaisir à vivre, se sentir en sécurité et en bonne santé.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Et c’est parce que nous avons tous les moyens d’agir pour notre santé, qu’il est plus que nécessaire de redevenir acteur de notre vie et non plus subir les approches consuméristes qui nous sont bien souvent néfastes, que nous avons décidé de mettre en place cette formation complète et pratique en naturopathie destinée non seulement aux néophytes, mais aussi aux thérapeutes déjà en activité qui souhaitent ajouter une compétence complémentaire à leur offre.</span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\"><br></span></div><div style=\"\"><span style=\"color: rgb(102, 102, 102); font-family: Montserrat-Light; font-weight: 700;\">Devenez Naturopathe Certifié :&nbsp;<a href=\"http://go.646b6a706d696b65z2ec6164766973696f6e.1.1tpe.net\">http://go.646b6a706d696b65z2ec6164766973696f6e.1.1tpe.net</a></span></div></div></div></div></div></span></span></div></div></div>', '', '2019-06-25 07:50:24', ''),
