(63, 78, 'texte', '\r\n\r\n<p align=\"left\" style=\"margin: 0px; text-align: left;\"><b><span style=\'margin: 0px; color: rgb(255, 120, 0); font-family: \"Verdana\",\"sans-serif\"; font-size: 10.5pt;\'>Conte\r\ndu Juge de Mesle</span></b><span style=\'margin: 0px; color: rgb(85, 96, 116); font-family: \"Verdana\",\"sans-serif\"; font-size: 8.5pt;\'></span></p>\r\n\r\n<span style=\'margin: 0px; color: rgb(85, 96, 116); font-family: \"Verdana\",\"sans-serif\"; font-size: 8.5pt;\'>Deux avocats qui ne s\'accordaient point <br>\r\nRendaient perplexe un juge de province: <br>\r\nSi ne put onc découvrir le vrai point; <br>\r\nTant lui semblait que fût obscur et mince. <br>\r\nDeux pailles prend d\'inégale grandeur: <br>\r\nDu doigt les serre; il avait bonne pince <br>\r\nLa longue échet sans faute au défendeur, <br>\r\nDont renvoyé s\'en va gai comme un prince <br>\r\nLa cour s\'en plaint, et le juge repart: <br>\r\nNe me blâmez, Messieurs, pour cet égard <br>\r\nDe nouveauté dans mon fait il n\'est maille; <br>\r\nMaint d\'entre vous souvent juge au hasard <br></span><div><span style=\'margin: 0px; color: rgb(85, 96, 116); font-family: \"Verdana\",\"sans-serif\"; font-size: 8.5pt;\'>\r\nSans que pour ce tire à la courte paille.</span></div><div><span style=\'margin: 0px; color: rgb(51, 51, 51); font-family: \"Arial\",\"sans-serif\"; font-size: 13.5pt;\'><b><i>Jean\r\nde la Fontaine</i></b></span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></div>', '', '2019-06-25 16:33:08', ''),
(67, 90, 'texte', '<h1 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-size: 10pt; text-align: center;\"><span style=\"font-size: xx-large;\">Créer une boutique de produits numériques en ligne gratuitement</span></h1><div style=\"font-weight: normal;\"><h6 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-size: 10pt;\"><br></h6><h6 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-size: 10pt;\"><span style=\"font-size: large; font-weight: normal;\"><a href=\"http://www.1tpe.com/index-pro.php?p=dkjpmike\">1TPE</a> est une plateforme d’affiliation reconnue datant de 2007 créée par Sylvain Milon.</span></h6><h6 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-size: 10pt;\"><span style=\"font-size: large; font-weight: normal;\"><br></span></h6><h6 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-size: 10pt;\"><span style=\"font-size: large; font-weight: normal;\">C’est un site qui applique un système de vente par affiliation et qui dispose d´un catalogue dans lequel se trouvent environ 13.788 références.</span></h6><h6 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-size: 10pt;\"><span style=\"font-size: large; font-weight: normal;\"><br></span></h6><h6 style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-size: 10pt;\"><span style=\"font-size: large; font-weight: normal;\">Les commissions varient de 10% à 70% du prix hors taxe du produit.</span></h6><h6 st